    true,nt"url": null,nt"notes": "<p>This RSS Feed represents all Collaborative
    Research and Development (CRADA) opportunities available from the National Institutes
    of Health (NIH).The intent of Congress in establishing CRADAs was to promote national
    technological competitiveness and the rapid transfer of the fruits of innovation
    to the marketplace. CRADA research and development at the NIH should be directed
    to the development of biological and behavioral technology, products, and processes
    by transferring relevant knowledge acquired from NIH research efforts to state and
    local governments, universities, and the private sector.</p>n",nt"owner_org":
